import React from 'react'
import { ClipLoader } from 'react-spinners'
import "./Spinner.css"

type Props = {
    isLoading?: boolean
}

const Spinner = ({isLoading = true}: Props) => {

  return (
    <>
        <div id="loading-spionner">
            <ClipLoader
                color="#36D7B7"
                loading={isLoading}
                size={35}
                aria-label="Loading Spinner"
                data-testid="loader"
            />
        </div>
    </>
  )
}

export default Spinner
